import React from 'react'

import styles from './Layout.module.scss'

const Layout = ({ children, color }) => {
  return (
    <div className={styles.container} id={color && styles.color}>
      <div
        style={{
          width: '100%',
          display: 'flex',
          minHeight: '100vh',
          position: 'absolute',
        }}
      >
        <div
          style={{ height: '100%', width: '25%', borderLeft: '1px solid red' }}
        ></div>
        <div
          style={{ height: '100%', width: '25%', borderLeft: '1px solid red' }}
        ></div>
        <div
          style={{ height: '100%', width: '25%', border: '1px solid red' }}
        ></div>
        <div style={{ height: '100%', width: '25%' }}></div>
      </div>
      <div className={styles.containerInner}>{children}</div>
    </div>
  )
}

export default Layout
